import React from "react";

function Card({ mealImg, mealAlt, mealName, mealCategory }) {
  return (
    <div className="card-wrapper">
      <img src={mealImg} alt={mealAlt} className="card-image" />
      <div className="card-body">
        <p className="category">{mealCategory}</p>
        <h3>{mealName}</h3>
      </div>
    </div>
  );
}

export default Card;
